        var videosPerPage = 5;
        var totalPages = Math.ceil(videoUrls.length / videosPerPage);

        function displayVideos(pageNumber) {
            var container = document.getElementById("videoContainer");
            container.innerHTML = "";

            var startIndex = (pageNumber - 1) * videosPerPage;
            var endIndex = startIndex + videosPerPage;

            var videosToDisplay = videoUrls.slice(startIndex, endIndex);

            for (var i = 0; i < videosToDisplay.length; i++) {
                var videoUrl = videosToDisplay[i];

                var scriptTag = document.createElement("script");
                scriptTag.setAttribute("data-url", videoUrl);
                scriptTag.setAttribute("data-width", "500px");
                scriptTag.setAttribute("data-height", "56.25%");
                scriptTag.setAttribute("src", "https://k2s.cc/js/preview.js");

                container.appendChild(scriptTag);
            }
        }

        function createPagination(currentPage) {
            var pagination = document.getElementById("pagination");
            pagination.innerHTML = "";

            var startPage = Math.max(1, currentPage - 6);
            var endPage = Math.min(totalPages, currentPage + 6);

            var paginationContent = "";

            if (startPage > 1) {
                paginationContent += createPageLink(1);
                if (startPage > 2) {
                    paginationContent += createEllipsis();
                }
            }

            for (var i = startPage; i <= endPage; i++) {
                paginationContent += createPageLink(i, i === currentPage);
            }

            if (endPage < totalPages) {
                if (endPage < totalPages - 1) {
                    paginationContent += createEllipsis();
                }
                paginationContent += createPageLink(totalPages);
            }

            pagination.innerHTML = paginationContent;
        }

        function createPageLink(pageNumber, isActive = false) {
            var pageLink = document.createElement("a");
            pageLink.setAttribute("href", "javascript:void(0)");
            pageLink.setAttribute("onclick", "displayVideos(" + pageNumber + ")");
            pageLink.textContent = pageNumber;
            if (isActive) {
                pageLink.classList.add("active");
            }
            return pageLink.outerHTML;
        }

        function createEllipsis() {
            return '<span class="ellipsis">...</span>';
        }

        displayVideos(1);
        createPagination(1);
    </script>
